import React from "react";

const BreweryListComp = ({ breweries }) => (
  <div>
    {breweries.map((brewery, index) => (
      <div key={index}>
        <h3>{brewery.name}</h3>
        <p>{brewery.city}</p>
        <a href={brewery.website_url} target="_blank" rel="">
          {brewery.website_url}
        </a>
      </div>
    ))}
  </div>
);

export default BreweryListComp;
